{"tool_name": "Get Investment Flows", "definition": "Retrieve investment flows for a specified security type and ID", "arguments": [{"parameter_name": "type", "description": "One of the following values: etf|fund", "type": "string"}, {"parameter_name": "securityId", "description": "The value of securityId field returned in /market/v2/get-returns", "type": "string"}], "required": ["type", "securityId"], "results": [{"parameter_name": "investmentFlows", "description": "A list of investment flows for the specified security", "type": "array", "items": {"type": "dict", "properties": {"string": {"description": "The string of the investment flow", "type": "string"}, "amount": {"description": "The amount of the investment flow", "type": "float"}, "flowType": {"description": "The type of investment flow (e.g., inflow, outflow)", "type": "string"}}}}]}
{"tool_name": "Get Financials", "definition": "Retrieve financial data for a specific performance ID", "arguments": [{"parameter_name": "performanceId", "description": "Unique identifier for the performance", "type": "string"}, {"parameter_name": "reportType", "description": "Type of financial report (R - Restated, A - As originally reported)", "type": "string"}, {"parameter_name": "interval", "description": "Interval for financial data (quarterly, annual)", "type": "string"}], "required": ["performanceId"], "results": [{"parameter_name": "financialData", "description": "Financial data for the specified performance ID", "type": "dict"}, {"parameter_name": "reportType", "description": "Type of financial report", "type": "string"}, {"parameter_name": "interval", "description": "Interval for financial data", "type": "string"}]}
{"tool_name": "Get Social Moving Averages", "definition": "Retrieve the moving average of social media posts, comments, likes, and impressions for a specified ticker and timeframe.", "arguments": [{"parameter_name": "social", "description": "The social media platform to retrieve data from (Twitter or StockTwits).", "type": "string", "enum": ["twitter", "stocktwits"]}, {"parameter_name": "tickers", "description": "The ticker symbol(s) to retrieve data for.", "type": "string"}], "required": ["social", "tickers"], "results": [{"parameter_name": "moving_averages", "description": "The moving average of social media posts, comments, likes, and impressions for the specified ticker and timeframe.", "type": "array", "items": {"type": "dict", "properties": {"timeframe": {"description": "The timeframe for which the moving average is calculated (2-week intervals).", "type": "string"}, "posts": {"description": "The moving average of posts for the specified timeframe.", "type": "float"}, "comments": {"description": "The moving average of comments for the specified timeframe.", "type": "float"}, "likes": {"description": "The moving average of likes for the specified timeframe.", "type": "float"}, "impressions": {"description": "The moving average of impressions for the specified timeframe.", "type": "float"}}}}]}
{"tool_name": "Get Crypto Symbols", "definition": "Returns a list of all available crypto symbols", "arguments": [{"parameter_name": "exchange", "description": "The exchange to retrieve symbols from (e.g., Binance, Coinbase)", "type": "string"}, {"parameter_name": "currency", "description": "The currency to filter symbols by (e.g., USD, EUR)", "type": "string"}], "required": ["exchange"], "results": [{"parameter_name": "symbols", "description": "A list of available crypto symbols", "type": "array", "items": {"type": "string"}}, {"parameter_name": "message", "description": "A success or error message", "type": "string"}]}
