Do not include parameters not mentioned by the user or not present in the historical conversation."}, {"role": "user", "content": "I want to analyze my investment in IBM. Can you help me get the investment flows for IBM, available crypto symbols in Binance exchange, the quarterly income statement of IBM, social moving averages for IBM on Twitter, and financial data for my performance ID 'PF12345-67'?"}, {"role": "assistant", "content": "[Get Investment Flows:{'type'/"etf",'securityId'/"IBM"}, Get Crypto Symbols:{'exchange'/"Binance"}, Get Company Quarterly Income Statement:{'symbol'/"IBM"}, Get Social Moving Averages:{'social'/"twitter",'tickers'/"IBM"}, Get Financials:{'performanceId'/"PF12345-67"}]"}]
